/** 
 * Requests given permission. If the permission has been denied previously, a Dialog will prompt the user to grant the permission, otherwise it is requested directly.
 */
protected void requestPermission(final String permission,String rationale,final int requestCode){
  if (ActivityCompat.shouldShowRequestPermissionRationale(this,permission)) {
    showAlertDialog(getString(R.string.permission_title_rationale),rationale,new DialogInterface.OnClickListener(){
      @Override public void onClick(      DialogInterface dialog,      int which){
        ActivityCompat.requestPermissions(BaseActivity.this,new String[]{permission},requestCode);
      }
    }
,getString(R.string.label_ok),null,getString(R.string.label_cancel));
  }
 else {
    ActivityCompat.requestPermissions(this,new String[]{permission},requestCode);
  }
}
